import InputRadio from "../../../../UI/InputRadio/InputRadio";
import style from "./OptionRadioSub.module.css";

function OptionRadioSub(prop) {
  return (
    <div>
      <p>Select Data</p>
      <InputRadio id="income" name="data" lebel="income" />
      <InputRadio id="expense" name="data" lebel="expense" />
      <InputRadio id="net" name="data" lebel="net" />
    </div>
  );
}

export default OptionRadioSub;
